import React, { useCallback } from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';
import AppView from '../../components/app-view';
import theme from '../../design/theme';
import CustomInput from '../../components/input';
import style from '../../design/style';
import CustomButton from '../../components/button';
import navigationService from '../../navigation/navigation-service';
import useRefState from '../../../utils/hooks/use-ref-state';
import Validator from '../../../infrastructure/validator';
import useReRender from '../../../utils/hooks/use-re-render';
import { Actions as ApiCallActions } from '../../../redux/api-call/reducers';
import { useDispatch } from 'react-redux';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Actions as AuthActions } from '../../../redux/auth/reducers';
import CustomText from '../../components/text';

const Register = () => {
    const dispatch = useDispatch();
    const [formProps, formPropsRef, setFormProps] = useRefState({
        image:"",
    });
    const reRender = useReRender();
    const [validator] = useRefState(new Validator());
    const validatorScopeKey = validator.generateNewScopeKey();

    const updateFormProps = (values) => setFormProps(curr => ({ ...curr, ...values }));

    const onChange = (key) => (value) => updateFormProps({ [key]: value });

    const goToLogin = () => navigationService.goBack()

    const register = useCallback(() => {
        const isValid = validator.allValid();
        reRender();
        if (isValid) {
            updateFormProps({ loading: true });
            dispatch(ApiCallActions.NativePost({
                controller: "user",
                action: "register",
                data: formPropsRef.current,
                showAlertOnError: true,
                showLoading: true,
                onSuccess: async ({ data }) => {
                    global.token = data.token;
                    AsyncStorage.setItem("token", data.token);
                    global.userInfo = data
                    dispatch(AuthActions.setAuthState({
                        userInfo: data,
                        token: data.token,
                    }));
                },
                callback: () => updateFormProps({ loading: false })
            }))
        }
    }, []);


    return (
        <AppView
            showHeader={false}
            alignItems='center'
            justifyContent='space-around'
        >
            <View>
                <Image style={styles.logo} resizeMode='cover' source={require('../../../assets/logo.png')} />
                <CustomText h1>Pet App</CustomText>
            </View>
            <View style={style.w100}>

                <CustomInput
                    value={formProps.name}
                    label={'Ad'}
                    onChange={onChange('name')}
                    errorMessage={validator.registerDestructuring({ name: `name`, value: formProps?.name, rules: [{ rule: "required" }], validatorScopeKey })}
                />

                <CustomInput
                    value={formProps.lastName}
                    label={'Soyad'}
                    onChange={onChange('lastName')}
                    errorMessage={validator.registerDestructuring({ name: `lastName`, value: formProps?.lastName, rules: [{ rule: "required" }], validatorScopeKey })}
                />

                <CustomInput
                    value={formProps.phone}
                    label={'Telefon'}
                    onChange={onChange('phone')}
                    errorMessage={validator.registerDestructuring({ name: `phone`, value: formProps?.phone, rules: [{ rule: "required" }], validatorScopeKey })}
                />

                <CustomInput
                    value={formProps.email}
                    label={'E-posta'}
                    onChange={onChange('email')}
                    errorMessage={validator.registerDestructuring({ name: `email`, value: formProps?.email, rules: [{ rule: "isEmail" }, { rule: "required" }], validatorScopeKey })}
                />
                <CustomInput
                    label={'Şifre'}
                    secureTextEntry
                    value={formProps.password}
                    onChange={onChange('password')}
                    errorMessage={validator.registerDestructuring({ name: `password`, value: formProps?.password, rules: [{ rule: "required" }], validatorScopeKey })}
                />
                <CustomInput
                    label={'Şifre Tekrar'}
                    secureTextEntry
                    value={formProps.passwordAgain}
                    onChange={onChange('passwordAgain')}
                    errorMessage={validator.registerDestructuring({ name: `passwordAgain`, value: formProps?.passwordAgain, rules: [{ rule: "required" }, { rule: 'areEqual', value: formProps.password }], validatorScopeKey })}
                />

                <CustomButton flex={0} loading={formProps.loading} title={'Kayıt Ol'} color={theme.colors.background} backgroundColor={theme.colors.primary} onPress={register} />
                <CustomButton flex={0} title={'Hesabın var mı? Giriş Yap'} backgroundColor={'transparent'} color={theme.colors.primary} onPress={goToLogin} />
            </View>
        </AppView>
    );
};

const styles = StyleSheet.create({
    logo: {
        borderRadius: 100,
        overflow: 'hidden',
        width: 200,
        height: 200,
        marginBottom: 20
    },
    appName: {
        // Styles for app name
    },
    input: {
        // Styles for input fields
    },
    signupText: {
        // Styles for signup text
    },
});

export default Register;
